<div class="entities" style="line-height: 2.5; direction: ltr">Poly ( ADP-ribose ) metabolism in X-irradiated Chinese hamster cells : its relation to repair of potentially lethal damage . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 - adenine dinucleotide ( NAD + ) is the substrate used by cells in poly ( ADP-ribose ) synthesis . X-irradiation of log-phase Chinese hamster cells caused a rapid decrease in NAD + levels which was linearly dependent on radiation dose . The activity of ADP-ribosyl transferase ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 ) also increased linearly with radiation dose . The decrease of NAD + was slower , and the increase in 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P09874
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>

 activity was less pronounced , in a radiation sensitive line , V79 - AL162 / S - 10 . An inhibitor of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P09874

</mark>
 , m-aminobenzamide , largely prevented the depletion of cellular NAD + and reduced the rate at which 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P09874
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 activity disappeared during post-irradiation incubation . Post-irradiation treatment with hypertonic buffer or with medium containing D2O - - which inhibit repair of radiation-induced potentially lethal damage - - enhanced the depletion of NAD + and prevented the reduction in 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 activity following irradiation . The characteristics of the effects of treatment with hypertonic buffer on NAD + metabolism were qualitatively similar to the effects that such treatment has on radiation-induced cell killing . These results suggest that poly ( ADP-ribose ) synthesis after irradiation plays a role in the repair of potentially lethal damage .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Cell adhesion molecule uvomorulin expression in human breast cancer cell lines : relationship to morphology and invasive capacities . Loss of cell-cell adhesion in carcinoma cells may be an important step in the acquisition of an invasive , metastatic phenotype . We have examined the expression of the epithelial-specific cell adhesion molecule uvomorulin (

<div class="entities" style="line-height: 2.5; direction: ltr">[ Functional characteristics of calcium-sensitive adenylyl cyclase of ciliate Tetrahymena pyriformis ] . DB01373 - sensitive forms of adenylyl cyclase ( AC ) were revealed in most vertebrates and invertebrates and also in some unicellular organisms , in particular ciliates . We have shown for the first time that calcium cations influence the AC activity of ciliate Tetrahymena pyriformis . These cations at the concentrations of 0.2- 20 microM stimulated the enzyme activity , and maximum of catalytic effect was observed at 2 microM Ca2 + . DB01373 cations at a concentrations of 100 microM or higher inhibited the AC activity . P62158 antagonists W - 5 and W - 7 at the concentrations of 20-100 microM inhibited the catalytic effect induced by 5 microM Ca2 + and blocked the effect at higher concentrations of Ca2 + .

<div class="entities" style="line-height: 2.5; direction: ltr">Salmon DB00644 and its analogues bind the human placental receptor . OBJECTIVE : The presence of DB00644 receptors in the human placenta has been recognized for a number of years . However , mammalian DB00644 , which is expressed in placental tissues , has limited affinity for the chorionic receptor . On the basis of immunological and bioactivity data , we have previously proposed that the chorionic DB00644 may differ from mammalian DB00644 . METHODS : We have studied the affinity of another isoform of DB00644 ( ie , salmon DB00644 and stable analogues of this DB00644 isoform ) , and compared their receptor affinity to that of mammalian DB00644 and its analogues . RESULTS : Using our receptor assay method with the labeled mammalian DB00644 analogue 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB06719

</mark>
 , salmon DB00644 had a twofold greater affinity for the placental 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P30968
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 than did mammalian DB00644 and for the stable salmon DB00644 analogue the affinity was increased tenfold . Using a homologous receptor assay method with a stable salmon DB00644 analogue as label , the affinity for this salmon DB00644 analogue had a K ( d ) of 101 nmol / L . CONCLUSION : The presence of these higher affinity receptors for non-mammalian DB00644 in the human placenta has led us to propose that the chorionic tissues may express more than one isoform of DB00644 and that non-mammalian DB00644 , such as salmon DB00644 , may be potent regulators of placental functions .</div>
